syntax = "proto3";
package wiradata.users;

option go_package = "pb/users;users";
option java_package = "com.wiradata.erpapplication.users";
option java_multiple_files = true;

message Access {
  string id = 1;
  string name = 2;
  string parent_id = 3;
  string created_at =  4;
  string created_by = 5;
  string updated_at = 6;
  string updated_by = 7;
}